import './Dialogs.css';
import ListDialogs from "./ListDialogs/ListDialogs";
import DialogsItem from "./DialogsItem/DialogsItem";

const Dialogs = () => {
	return (
		<div className='dialogs'>
			<div className="dialogs__title">Dialogs</div>
			<div className="dialogs__body">
				<ListDialogs/>
				<div className="dialogs__current">

				</div>
				<DialogsItem/>
			</div>
		</div>
	)
}

export default Dialogs;
